  false,\n\t\"url\": null,\n\t\"notes\": \"Report on research activities regarding
  bullsnakes on the Crescent Lake National Wildlife Refuge, conducted by John Iverson
  and Earlham College.  research was conducted on the refuge from April 1st to July
  10th, 1990.  Primary goals of this study were to: 1) to examine snake capture data
  at the four drift fences on the Refuge in order to assess trapping effectiveness
  and ways to improve it, and 2) to experiment with artificial scents as attractants
  to lure snakes into funnel traps.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
